function Cards(pokemons) {
  return (
    <div className='cards'>
      {console.log("pokemons in cards", pokemons)}
       {pokemons.pokemons.map(function (pokemon){
      return (<><p>{pokemon.name}</p><img src={pokemon.image}></img></>)}
      )
      }


    </div>
  )
}

